import React from 'react';
import { Component } from 'react';


class Section extends Component {
   render(){
   return(
   
      <div>
        
           <div className="row text-center">
              <div className="col-sm-4 pt-3 pl-3 ">
                 <div style={{borderStyle:"solid",height:"20vh",backgroundColor:"red"}}>
                    Hello
                 </div>
              </div>
              <div className="col-sm-4">hii</div>
              <div className="col-sm-4">byee</div>
           </div>
           <div style={{height:"50vh"}}></div>
           <div className="row">
              <div className="col-sm-4">hello</div>
              <div className="col-sm-4">hii</div>
              <div className="col-sm-4">byee</div>
           </div>
             

    </div>
   
   )
}
}




export default Section;
